    private static List<String> makeQueryOptions() throws ParseException {
        Long start = DateUtils.getDateFromString("2019-05-20 10:01:10").getTime();
        Long end = DateUtils.getDateFromString("2019-05-20 11:2:10").getTime();
//        customProperties.getMaxIntervalTime() => 【定时任务最大时间间隔（秒）】
        Long maxInterval = 1000 * 600L;
//        customProperties.getTimeSlice() => 每次汇总时间段大小（秒）
        Long slice = 1000 * 120L;
        List<String> qovList = new ArrayList<>();
//        如果时间范围超出了【定时任务最大时间间隔】，则将开始时间调整为当前时间减去【定时任务最大时间间隔】
        start = end - start > maxInterval ? end - maxInterval : start;
//        如果开始时间不是slice的整数倍，则将其向后调整至最近的是slice整数倍的值
        log.info("start = {},date={}",start,DateUtils.getStringFromDate(start));
        start = start % slice != 0 ? (start / slice + 1) * slice : start;
        while (start <= end - slice) {
        	String time = DateUtils.getStringFromDate(start)+", "+DateUtils.getStringFromDate(start + slice)+"";
        	qovList.add(time);
            start += slice;
        }
        qovList.forEach(System.out::println);
        return qovList;
    }
