    /**
     * 
     * @Description: 中文字符
     * @param s
     * @return
     * @author: LiWenming 
     * @date:   2019年5月24日 下午6:18:41 
     * @throws
     */
    public static int getWordCount(String s)  
    {  
        int length = 0;  
        for(int i = 0; i < s.length(); i++)  
        {  
            int ascii = Character.codePointAt(s, i);  
            if(ascii >= 0 && ascii <=255)  
                length++;  
            else  
                length += 2;  
        }  
        return length;  
    }
